<?php
// Arquivo: base64.php
// COLE SEU BASE64 AQUI ↓ (SUBSTITUA ESTE TEXTO PELO SEU BASE64 REAL)

$meu_base64 = "";

// Configurar cabeçalhos
header('Content-Type: application/json');
header('Access-Control-Allow-Origin: *');

// Verificar se o Base64 foi configurado
if ($meu_base64 === "" || empty($meu_base64)) {
    echo json_encode([
        'status' => 'error',
        'message' => 'Configure o Base64 no arquivo PHP!',
        'instrucao' => 'Substitua "" pelo seu Base64 real'
    ]);
    exit;
}

// Retornar o Base64
echo json_encode([
    'status' => 'success',
    'base64' => $meu_base64,
    'tamanho' => strlen($meu_base64),
    'mensagem' => 'Pronto para download'
]);
?>
